import React from 'react'
import './Banner.css'
import BarChart from './BarChart.js'
function Banner() {
    const objects =[{name:'asd',data:[4,5,3,52,34]},
{name:'cde',data:[10,20,30,40,33]},
];
    return (
        <div>
            <div className="Banner__container">
                <div className="Banner__today">Dziś: 14,3</div>
                <div className="Banner__all">Ogółem: 233</div>
                <div className="Banner__graph">
                    {objects.map((object)=>(
                    <BarChart data={object.data}
                    name={object.name}/>
                    ))}



                </div>
            </div>
        </div>
    )
}

export default Banner
